window.bookSummaryJSON = "<p>Quitting her job as a high school science teacher to join the Seattle Police Department was an easy decision for Tracy Crosswhite. Years earlier, what should have been one of the happiest days of her life instead became her worst nightmare when her younger sister, Sarah, disappeared. After the murder trial, while her family disintegrated, Tracy turned her heartbreak and her lingering questions into a passion for justice.</p> <p>But people don't just become world-class detectives. If Tracy wants to uncover the truth about what happened to her sister, first she must be forged in the fires of the Police Academy, where not everyone wants her to succeed.</p>"; 
